    private void jButton1MouseClicked(java.awt.event.MouseEvent evt) {//GEN-FIRST:event_jButton1MouseClicked
        
        //Initialize subject data
        this.subject = new Subject();
        subject.setSubjectNumber(Integer.parseInt(jTextField1.getText()));
        subject.setVisitNumber(Integer.parseInt(jTextField2.getText()));
        subject.setVisitDate(jTextField3.getText());
        
        //Check if demographics are needed
        if (subject.getVisitNumber() == 1) {
            DemographicsDialog.setBounds(0, 0, 522, 400);
            DemographicsDialog.setVisible(true);
        }
    }//GEN-LAST:event_jButton1MouseClicked

    private void submitDemographicsMouseClicked(java.awt.event.MouseEvent evt) {//GEN-FIRST:event_submitDemographicsMouseClicked
        
        //Set date of birth
        subject.getDemographics().setDateOfBirth(dateOfBirthTextField.getText());
        
        //Set sex
        if (selectMale.isSelected()) {
            subject.getDemographics().setSex("Male");
        }
        if (selectFemale.isSelected()) {
            subject.getDemographics().setSex("Female");
        }
        
        //Set race
        if (selectAsian.isSelected()) {
            subject.getDemographics().setRace("Asian");
        }
        if (selectAfricanAmerican.isSelected()) {
            subject.getDemographics().setRace("African American");
        }
        if (selectCaucasian.isSelected()) {
            subject.getDemographics().setRace("Caucasian");
        }
        
        //Set ethnicity
        if (selectHispanic.isSelected()) {
            subject.getDemographics().setEthnicity("Hispanic/Latino");
        }
        if (selectNonHispanic.isSelected()) {
            subject.getDemographics().setEthnicity("non-Hispanic/non-Latino");
        }
        
        //Close demographics dialog and open vital signs
        vitalSignsDialog.setBounds(0,0,736,420);
        vitalSignsDialog.setVisible(true);
        DemographicsDialog.setVisible(false);
        
        
        
    }//GEN-LAST:event_submitDemographicsMouseClicked

