    private void submitVitalSignsPanelMouseClicked(java.awt.event.MouseEvent evt) {//GEN-FIRST:event_submitVitalSignsPanelMouseClicked
    
        //Get the vital signs for subject
        VitalSigns vitals = subject.getVisit().getVitalSigns();
        
        //Set the temperature
        if (celsiusButton.isSelected()) {
            vitals.setTemperature(Double.parseDouble(temperatureField.getText()), VitalSigns.TemperatureUnit.C);
        }
        if (fahrenheitButton.isSelected()) {
            vitals.setTemperature(Double.parseDouble(temperatureField.getText()), VitalSigns.TemperatureUnit.F);
        }
        
        //Set the sitting pulse
        vitals.setSittingPulse(Double.parseDouble(bpmField.getText()));
        
        //Set site used
        if (rightArmButton.isSelected()) {
            vitals.setSiteUsed(VitalSigns.SiteUsed.RIGHT_ARM);
        }
        if (leftArmButton.isSelected()) {
            vitals.setSiteUsed(VitalSigns.SiteUsed.LEFT_ARM);
        }
        
        //Set the sitting BP
        vitals.setSystolicBP(Double.parseDouble(systolicField.getText()));
        vitals.setDiastolicBP(Double.parseDouble(diastolicField.getText()));
        
        //Set the weight
        if (lbButton.isSelected()) {
            vitals.setWeight(Double.parseDouble(weightField.getText()), VitalSigns.WeightUnit.LB);
        }
        if (kgButton.isSelected()) {
            vitals.setWeight(Double.parseDouble(weightField.getText()), VitalSigns.WeightUnit.KG);
        }
        
        //Set the height
        if (inchesButton.isSelected()) {
            vitals.setHeight(Double.parseDouble(heightField.getText()), VitalSigns.HeightUnit.Inches);
        }
        if (cmButton.isSelected()) {
            vitals.setHeight(Double.parseDouble(heightField.getText()), VitalSigns.HeightUnit.cm);
        }
        
        //Set respiration and BPM
        vitals.setRespiration(Double.parseDouble(respirationField.getText()));
        vitals.setBodyMassIndex(Double.parseDouble(bmiField.getText()));
        
        //Close window
        vitalSignsDialog.setVisible(false);
        npiDialog.setVisible(true);
    }//GEN-LAST:event_submitVitalSignsPanelMouseClicked

    private void submitNPIMouseClicked(java.awt.event.MouseEvent evt) {//GEN-FIRST:event_submitNPIMouseClicked
        //Get the NPI for subject
        NPI npi = subject.getVisit().getNpi();
        
        //Set the delusions scores
        npi.getDelusions().setFrequency(Integer.parseInt(delusionsFrequencyField.getText()));
        npi.getDelusions().setSeverity(Integer.parseInt(delusionsSeverityField.getText()));
        
        //Set the hallucination scores
        npi.getHallucinations().setFrequency(Integer.parseInt(hallucinationFrequencyField.getText()));
        npi.getHallucinations().setSeverity(Integer.parseInt(hallucinationSeverityField.getText()));
        
        //Set the agitation/aggression scores
        npi.getAgitation().setFrequency(Integer.parseInt(agitationFrequencyField.getText()));
        npi.getAgitation().setSeverity(Integer.parseInt(agitationSeverityField.getText()));
        
        //Set the depression scores
        npi.getDepression().setFrequency(Integer.parseInt(depressionFrequencyField.getText()));
        npi.getDepression().setSeverity(Integer.parseInt(depressionSeverityField.getText()));
        
        //Set the anxiety scores
        npi.getAnxiety().setFrequency(Integer.parseInt(anxietyFrequencyField.getText()));
        npi.getAnxiety().setSeverity(Integer.parseInt(anxietySeverityField.getText()));
        
        //Set the elation/euphoria scores
        npi.getElation().setFrequency(Integer.parseInt(elationFrequencyField.getText()));
        npi.getElation().setSeverity(Integer.parseInt(elationSeverityField.getText()));
        
        //Set the apathy/indifference scores
        npi.getApathy().setFrequency(Integer.parseInt(apathyFrequencyField.getText()));
        npi.getApathy().setSeverity(Integer.parseInt(apathySeverityField.getText()));
        
        //Set the disinhibition scores
        npi.getDisinhibition().setFrequency(Integer.parseInt(disinhibitionFrequencyField.getText()));
        npi.getDisinhibition().setSeverity(Integer.parseInt(disinhibitionSeverityField.getText()));
        
        //Set the irritability scores
        npi.getIrritability().setFrequency(Integer.parseInt(irritabilityFrequencyField.getText()));
        npi.getIrritability().setSeverity(Integer.parseInt(irritabilitySeverityField.getText()));
        
        //set the aberrant motor behavior scores
        npi.getAberrantMotorBehavior().setFrequency(Integer.parseInt(aberrantFrequencyField.getText()));
        npi.getAberrantMotorBehavior().setSeverity(Integer.parseInt(aberrantSeverityField.getText()));
        
        //Close window
        npiDialog.setVisible(false);
        
        //Create output dialog for testing
        String s = "Case Report Form\n\nSubject Number: " + subject.getSubjectNumber() + "\n" +
            "Visit Number: " + subject.getVisitNumber() + "\n" +
            "Visit Date: " + subject.getVisitDate() + "\n\n" +
            "Demographics\nDate of Birth: " + subject.getDemographics().getDateOfBirth() +"\n" +
            "Sex: " + subject.getDemographics().getSex() + "\n" +
            "Race: " + subject.getDemographics().getRace() + "\n" +
            "Ethnicity: " + subject.getDemographics().getEthnicity() +"\n\n" +
            "Vital Signs\n\nTemperature: " + subject.getVisit().getVitalSigns().getTemperature() + "\n" +
            "Sitting Pulse: " + subject.getVisit().getVitalSigns().getSittingPulse() + "\n" +
            "Site Used: " + subject.getVisit().getVitalSigns().getSiteUsed() + "\n" +
            "Sitting Blood Pressure: " + subject.getVisit().getVitalSigns().getSystolicBP() + "/" +
            subject.getVisit().getVitalSigns().getDiastolicBP() + "\n" +
            "Weight: " + subject.getVisit().getVitalSigns().getWeight() + "\n" +
            "Height: " + subject.getVisit().getVitalSigns().getHeight() + "\n" +
            "Respiration: " + subject.getVisit().getVitalSigns().getRespiration() + "\n" +
            "Body Mass Index: " + subject.getVisit().getVitalSigns().getBodyMassIndex() + "\n";
            
        variablePrintArea.setText(s);
        outputDataDialog.setVisible(true);
    }//GEN-LAST:event_submitNPIMouseClicked

